import React from 'react';
import ReactDOM from 'react-dom';
import { Provider } from "react-redux";
import store from './Store/store';
import './index.css';
import { App } from './App';

const Index = () => (
  <Provider store={store}>
    <App />
  </Provider>
);

ReactDOM.render(<Index></Index>, document.getElementById('root'));
